import React from 'react';
import Contact from '../components/Contact';

/**
 * Contact Page Component
 * Dedicated page for contact information and communication
 */
const ContactPage = () => {
  return (
    <div className="page page--contact">
      <Contact />
    </div>
  );
};

export default ContactPage;
